// import dataSet from "./dataSet";

class Project extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        items: [],
        isLoaded: false,
      };
    }

    componentDidMount() {
      fetch('https://jsonplaceholder.typicode.com/posts')
        .then(res => res.json())
        .then(result => {
          this.setState({
            isLoaded: true,
